import React, { useEffect, useState } from "react";
import "./All.css"
import Navbar from "../Component/Navbar";
import icon from "../Resimler/superligg.jpg"
import tff from "../Resimler/super.jpg";
import ziraat from "../Resimler/tffe.jpg";
import axios from "axios";
import { useNavigate, useParams } from "react-router-dom"



const OyuncuOlusturma = () => {
    let {id} =useParams();
    const data = { name: "", age: "", number: "", position: "", team: "", team_id: "", };
    const [oyuncu, setOyuncu] = useState(data)
    const navigate = useNavigate();



    const [takım,setTakım]=useState([])
    const [yonlendirme,setYönlendirme]=useState([]) 

    useEffect(() => {
        const api_cek = `https://cryptic-gorge-72989.herokuapp.com/teams/${id}`
        axios.get(api_cek)
            .then(response => {
                setYönlendirme(response.data)
            })
    }, [id])



    useEffect(() => {
        const api_link = "https://cryptic-gorge-72989.herokuapp.com/teams"
        axios.get(api_link)
            .then(response => {
                setTakım(response.data)
            })
    }, [])

    const handleData = (e) => {
        setOyuncu({ ...oyuncu, [e.target.name]: e.target.value })
        console.log(setOyuncu)
    }

    const handleSubmit = (e) => {
        e.preventDefault();
        axios.post("https://cryptic-gorge-72989.herokuapp.com/players", oyuncu)
            .then((respons) => {
                console.log(respons)
                navigate(`/${yonlendirme.id}/Oyuncular`);  
                console.log(respons)  
                alert("başarılı Oyuncu Kayıt")          
            })
    }
    return (
        <div>
            <Navbar /><br />
            <div className="Takım_cerceve">
                <div className="Takım_cerceve_iç">
                    <div className="orta">
                        <img src={icon} width="50" /><br /><br />
                        <p>Oyuncu Ekle <i class="fa-light fa-plus fa-fade"></i></p>
                    </div>
                    <div className="orta">
                        <div class="form-floating mb-3">
                            <input name="name" value={oyuncu.name} onChange={handleData} type="text" class="form-control" placeholder="name@example.com" />
                            <label for="floatingInput">Futbolcunun İsmi</label>
                        </div>
                        <div class="form-floating mb-3">
                            <input name="age" value={oyuncu.age} onChange={handleData} type="number" class="form-control" placeholder="name@example.com" />
                            <label for="floatingInput">Yaş</label>
                        </div>
                        <div class="form-floating mb-3">
                            <input name="number" value={oyuncu.number} onChange={handleData} type="number" class="form-control" placeholder="name@example.com" />
                            <label for="floatingInput">Forma Numara</label>
                        </div>
                        <div class="form-floating mb-3">
                            <input name="position" value={oyuncu.position} onChange={handleData} type="text" class="form-control" placeholder="name@example.com" />
                            <label for="floatingInput">Oynadıgı Podisyon</label>
                        </div>
                        <div class="form-floating mb-3">
                            <div class="dropdown">
                                <button style={{width:440,height:60,background:"white",color:"black",fontSize:15}} name="name" value={oyuncu.name} onChange={handleData} class="btn btn-secondary dropdown-toggle" type="button" data-bs-toggle="dropdown" aria-expanded="false">
                                    <p style={{textAlign:"left",marginTop:10}}>Oyandıgı Takım</p>
                                </button>
                                <ul class="dropdown-menu">
                                    {
                                        takım.map(takım=>
                                            <li><a class="dropdown-item" href="#">
                                                {takım.name}
                                        </a></li>
                                            )
                                    }
                                </ul>
                            </div>
                        </div>
                        <div class="form-floating mb-3">
                            <input name="team_id" value={oyuncu.team_id} onChange={handleData} type="number" class="form-control" placeholder="name@example.com" />
                            <label for="floatingInput">Oynadıgı Takım Hangi sırada</label>
                        </div>
                        <div class="container px-4 text-center">
                            <div class="row gx-5">
                                <div class="col">
                                    <div class="p-3"><button onClick={handleSubmit} style={{ height: 50, width: 140 }} className="btn btn-primary">Ekle <i class="fa-light fa-plus fa-fade"></i></button></div>
                                </div>

                            </div>
                        </div>
                    </div>
                </div>
            </div><br />
            <div style={{ textAlign: "center" }} className="">
                <img src={icon} width="189" />
                <img src={tff} width="200" />
                <img src={ziraat} width="189" />
            </div><br />
        </div>
    )
}
export default OyuncuOlusturma;
